import ProductSale from "../components/ProductSale";

const Featured = () => {
  return (
    <section class="featured">
      <div class="featured-items">
        {items.map(a => {
            <ProductSale item={a} class="grid-item" />
        })}
      </div>
      <div class="featured-video">
        <iframe
          src="https://assets.pinterest.com/ext/embed.html?id=187040190766436100"
          height="714"
          width="345"
          frameborder="0"
        ></iframe>
      </div>
    </section>
  );
};

export default Featured;
